var tipuesearch = {"pages":[{"title":"Changelog","text":"  All notable changes to this project will be documented in this file.  The format is based on Keep a Changelog, and this project adheres to Semantic Versioning.  [Unreleased]   lorem   [N.N.N] - YYYY-MM-DD  Added   lorem   Changed   lorem   Deprecated   lorem   Removed   lorem   Fixed   lorem   Security   lorem  ","tags":"","url":"CHANGELOG.html"},{"title":"Environment Indicator Loft Drupal Module","text":"    Summary  This is an alternative UX for the Drupal module  Environment Indicator by In the Loft Studios.  It removes the color in the Admin toolbar, and wraps the entire screen in a faint edge glow.  It provides the GIT branch in the description.  It allows hiding the indicator by clicking or double clicking the title\/description area.  Visit https:\/\/aklump.github.io\/environment_indicator_loft for full documentation.  Quick Start   Configure Environment Indicator as per that module's instructions. Download this module to web\/modules\/custom\/. Enable this module and the UX of the module will change. drush en environement_indicator_loft   Requirements   Environment Indicator Drupal module   Contributing  If you find this project useful... please consider making a donation.  Usage   Single click the title in the bottom right hand and the indicator will be hidden for that request. Double click the title and a cookie will be set for 30 minutes to hide the indicator.  You can use this if you are doing some critical theming and you do not want the visual interference of the border for a time.   Contact The Developer  In the Loft Studios Aaron Klump - Web Developer sourcecode@intheloftstudios.com 360.690.6432 PO Box 29294 Bellingham, WA 98228-1294 skype: intheloftstudios  http:\/\/www.intheloftstudios.com https:\/\/github.com\/aklump ","tags":"","url":"README.html"},{"title":"Summary","text":"  This is an alternative UX for the Drupal module  Environment Indicator by In the Loft Studios.  It removes the color in the Admin toolbar, and wraps the entire screen in a faint edge glow.  It provides the GIT branch in the description.  It allows hiding the indicator by clicking or double clicking the title\/description area.  Visit https:\/\/aklump.github.io\/environment_indicator_loft for full documentation.  Quick Start   Configure Environment Indicator as per that module's instructions. Download this module to web\/modules\/custom\/. Enable this module and the UX of the module will change. drush en environement_indicator_loft   Requirements   Environment Indicator Drupal module   Contributing  If you find this project useful... please consider making a donation.  Usage   Single click the title in the bottom right hand and the indicator will be hidden for that request. Double click the title and a cookie will be set for 30 minutes to hide the indicator.  You can use this if you are doing some critical theming and you do not want the visual interference of the border for a time.  ","tags":"","url":"drupal_project_page.html"},{"title":"Search Results","text":" ","tags":"","url":"search--results.html"}]};
